Phoenix invited her employee Toni to read him the riot act. She was sick and tired of pulling all the dead weight around while she did all the heavy lifting and everyone else had fun. She was fed up with making sure all of her subordinates remained employed while they partied and was ready to make an example out of Toni. Toni begged and pleaded for another chance until the whole conversation reached a fever pitch. At that moment, all of her frustrations, stresses and anxieties spilled over and she finally broke down. She ripped her shirt off and revealed her giant tits. She was ready to cut loose like everyone else and blow off some steam... or blow Toni, whichever came first.
